" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 549px\">",
"   <div class=\"ttl\">",
"    Example of 32-site bipolar mapping of ventricular tachycardia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 529px; height: 235px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The outer circle is located near the base of the left ventricle (LV) while the inner circle is positioned within the LV apex. Mapping during sinus rhythm (SR) (left panel) shows that the earliest endocardial activation (red) is in the region near the basal septum; activation then spread rapidly in a radial pattern over the endocarium. The area in purple/pink is activated last. During ventricular tachycardia (VT) (right panel) there is change in the activation sequence and an increase in the activation time, indicated by the blue/purple color over the majority of the LV endocardium.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     With permission from: Schalij MJ, van Rugge P, Siezenga M, et al. Circulation 1998; 98:2168.",
"    </div>",
"   </div>",
