var title_f29_58_30634="12-lead ECG right posteroseptal WPW I";
var content_f29_58_30634=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F69988%7ECARD%2F57211%7ECARD%2F59055%7ECARD%2F71868&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F69988%7ECARD%2F57211%7ECARD%2F59055%7ECARD%2F71868&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 536px\">",
"   <div class=\"ttl\">",
"    12-lead electrocardiogram (ECG) of a right posteroseptal accessory AV pathway",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 516px; height: 289px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Electrocardiogram in sinus rhythm from a patient with Wolff-Parkinson-White syndrome shows a maximally preexcited QRS complex. There is early transition across the precordial leads, with R/S ratio of 1 occurring in lead V2. The delta waves are positive in the lateral leads I, aVL, and V6, and negative in leads III and aVF, localizing the pathway to the posteroseptal area. The positive delta wave in lead II and in the lateral leads localize the pathway to the right side.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 534px\">",
"   <div class=\"ttl\">",
"    12-lead electrocardiogram (ECG) of a right posteroseptal accessory AV pathway",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 514px; height: 311px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Electrocardiogram during rapid atrial pacing from a patient with Wolff-Parkinson-White syndrome. The QRS complex is maximally excited; the PR interval is short, and there is a left bundle branch morphology, left axis deviation, and early transition across the anterior precordial leads. The delta waves are positive in the lateral leads I, aVL, and V6 and negative in the inferior leads, localizing the pathway to the posteroseptal region. The negative delta wave in lead II places the pathway on the right, in the area between the coronary sinus os and middle cardiac vein.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 535px\">",
"   <div class=\"ttl\">",
"    12-lead electrocardiogram (ECG) of a right posteroseptal accessory AV pathway",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 515px; height: 316px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The 12 lead ECG during rapid atrial pacing shows QRS complexes that are maximally preexcited; the complexes have a pattern suggesting an AV accessory pathway located in the right posteroseptal area. At the time of ablation, the pathway was localized to the midseptal region.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 518px\">",
"   <div class=\"ttl\">",
"    12-lead electrocardiogram (ECG) of a left posteroseptal accessory AV pathway",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 498px; height: 295px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Electrocardiogram during right atrial pacing in a patient with Wolff-Parkinson-White syndrome shows a long stimulus to the P wave with a short PR interval, the appearance of both right and left bundle branch block morphologies, and a negative QRS morphology and delta wave in the inferior leads. This localizes the pathway to the posteroseptal area. The presence of a positive delta wave in lead I, RS ratio in lead V1 of approximately 1, and a negative delta wave in lead II places the pathway on the left side, inside the coronary sinus os or allong the middle cardiac vein. This type of accessory pathway may be related to cardiac venous anomalies and aneurysms.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
